import Link from 'next/link';

import thumbnailStyle from './thumbnail.module.css';

const Thumbnail = ({
    imageURL = "http://via.placeholder.com/210x295?text=?",
    caption,
    href="",
    as=""
}) => {
    return (
        <div>
            <Link href={href} as={as}>
                <a>
                    <img src={imageURL} className={thumbnailStyle.image} />
                    <h3 className={thumbnailStyle.caption}>{caption}</h3>
                </a>
            </Link>
        </div>
    );
};

export default Thumbnail;
